import React, { useState } from 'react';

function Table() {

    // Énumération pour les statuts des nurses (enum fonctionne pas en JS)
    const Status = Object.freeze({
        Bim: 1,
        NotBim: 0
    });

    const [nurses, setNurses] = useState([
        { id: 1, name: 'Jean', lastName: 'Dupont', status: Status.Bim, address: '1 rue de la compétence', NissNumber: '97.11.04-732.01', insuranceCompanyNumber: '500'},
        { id: 2, name: 'Marie', lastName: 'Durand', status: Status.notBim, address: '2 rue de la compétence', NissNumber: '98.10.28-735.02', insuranceCompanyNumber: '509'},
    ]);

    // État pour stocker les valeurs des champs de formulaire
    const [newNurse, setNewNurse] = useState({ name: '', email: '', phone: '' });

    return (
        <div>
            <h1>Gestion de la base de nurses</h1>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Nom</th>
                        <th>Email</th>
                        <th>Téléphone</th>
                    </tr>
                </thead>
                <tbody>
                    {nurses.map((nurse) => (
                        <tr key={nurse.id}>
                            <td>{nurse.id}</td>
                            <td>{nurse.name}</td>
                            <td>{nurse.email}</td>
                            <td>{nurse.phone}</td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <h2>Ajouter un nouveau nurse</h2>
            <div>
                <input
                    type="text"
                    name="name"
                    placeholder="Nom"
                    value={newNurse.name}
                    onChange={handleInputChange}
                />
                <input
                    type="email"
                    name="email"
                    placeholder="Email"
                    value={newNurse.email}
                    onChange={handleInputChange}
                />
                <input
                    type="text"
                    name="phone"
                    placeholder="Téléphone"
                    value={newNurse.phone}
                    onChange={handleInputChange}
                />
            </div>
        </div>
    );
}

export default Table;
